          } else if (item.name == "superman2") {
            arrCount[1].value++;
          } else if (item.name == "superman3") {
            arrCount[2].value++;
          }
          if (item.count) {
            useCount.value += item.count;
          }
        });
        return array;
      },

      // 将图像列表分配给supermanList
      assignImageList(supermanList, images) {
        const shuffledImages = allMethods.shuffleArray(images.slice()); // 避免修改原始数组
        console.log(
          "%c ..........shuffledImages.........",
          "color:#31ef0e",
          shuffledImages
        );
        let currentIndex = 0;
        supermanList.forEach((item) => {
          const numImages = Math.min(item.size, 5);
          item.imgList = shuffledImages.slice(
            currentIndex,
            currentIndex + numImages
          );
          currentIndex += numImages;
        });
        console.log(
          "%c ..........supermanList.........",
          "color:#31ef0e",
          supermanList
        );
        return supermanList;
      },
      goSeniority: () => {
        router.push("/list");
      },
    };
    onMounted(() => {



    });
    return {
      className,
      open,
      stsuperman,
      supermanConfig,
      randomImages,
      supermanList,
      countValue,
      useCount,
      showRuleValue,
      arrCount,
      ...allMethods,
    };
  },
};



